import { FastField } from "formik";
import React from "react";
import { useEffect } from "react";

export const Radiobtn = ({ lengthUnit, setLengthUnit }) => {
  useEffect(() => {
    console.log(lengthUnit);
  }, [lengthUnit]);
  return (
    <div>
      <FastField>
        {() => (
          <>
            <div class="control d-flex align-items-center">
              <span>بر حسب : </span>
              <label class="radio ps-1">
                سال
                <input
                  type="radio"
                  name="answer"
                  value="سال"
                  onClick={(e) => {
                    setLengthUnit(e.target.value);
                  }}
                  //checked={lengthUnit == "سال" ? true : false}
                />
              </label>
              <label class="radio">
                ماه
                <input
                  type="radio"
                  name="answer"
                  value="ماه"
                  onClick={(e) => {
                    setLengthUnit(e.target.value);
                    console.log(lengthUnit);
                  }}
                  //checked={lengthUnit == "ماه" ? true : false}
                />
              </label>
            </div>
          </>
        )}
      </FastField>
    </div>
  );
};
